import { Col, Row, Container } from "react-bootstrap";
import Nav from "../nav/Nav";
import ToDoList from "../todo/ToDoList";

function App() {
  return (
    <>
      <Container>
        <Row>
          <Col>
            <Nav/>
            <ToDoList/>
          </Col>
        </Row>
      </Container>


    </>
  );
}

export default App;
